extNode("\n  ");e.appendChild(n,a);var a=e.createElement("p"),r=e.createTextNode("\n    Středobodem semináře je graf úloh, který se snažíš projít a po cestě vyřešit co nejvíce úloh zvládneš.\n    Některé části grafu představují základní myšlenky, pojmy a postupy a obsahují jednoduché úlohy, jejichž správnost se vyhodnocuje okamžitě automaticky.\n    Jiné obsahují hlavní soutěžní úlohy, na jejichž vyřešení a sepsání máš zhruba jeden měsíc.\n    Po termínu odevzdání se úloha uzamkne, my tvoje řešení opravíme, přidělíme ti za něj body, poskytneme ti k němu zpětnou vazbu a zveřejníme vzorové řešení úlohy.\n    Soutěžní úlohy jsou pak různého charakteru a zatímco nejjednodušší úlohy by po projití úvodních uzlů grafu měl zvládnout každý, nad tou nejtěžší se může zapotit i ostřílený řešitel programátorských soutěží.\n  ");e.appendChild(a,r),e.appendChild(n,a);var a=e.createTextNode("\n\n  ");e.appendChild(n,a);var a=e.createElement("p"),r=e.createTextNode("\n    S ostatními účastníky i organizátory semináře se můžeš během roku potkat na několika výletech.\n    Koncem školního roku pak vyhlásíme výsledky a nejlepší řešitele pozveme na ");e.appendChild(a,r);var r=e.createElement("a");e.setAttribute(r,"href","https://kscuk.fi.muni.cz/");var l=e.createTextNode("týdenní soustředění K-SCUK");e.appendChild(r,l),e.appendChild(a,r);var r=e.createTextNode(".\n    Úspěšní řešitelé semináře (ti, kteří dosáhnou alespoň 60 % celkového počtu bodů) mají možnost si nechat prominout přijímací zkoušku na Fakultu informatiky MU. (");e.appendChild(a,r);var r=e.createElement("a");e.setAttribute(r,"href","/o-ksi?view=about#prominutiPrijimacek");var l=e.createTextNode("podrobněji níže");e.appendChild(r,l),e.appendChild(a,r);var r=e.createTextNode(")\n  ");e.appendChild(a,r),e.appendChild(n,a);var a=e.createTextNode("\n\n  ");e.appendChild(n,a);var a=e.createElement("h3"),r=e.createTextNode("Jaké úlohy mám očekávat?");e.appendChild(a,r),e.appendChild(n,a);var a=e.createTextNode("\n  ");e.appendChi